import React, { Component }  from 'react';
import { Form, Input, Button, Card, PageHeader } from 'antd';
import './index.less';

const layout = {
  labelCol: { span: 4 },
  wrapperCol: { span: 15 },
};
const tailLayout = {
  wrapperCol: { offset: 4, span: 15 },
};

class LoginPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
    }
  }

  onLoginFinish = values => {
    const { onLoginSuccess } = this.props;
    console.log(this.props);
    console.log('Success:', values);
    if (values.username === 'hahaha' && values.password === '20201023') {
      alert('登陆成功');
      onLoginSuccess();
    } else {
      alert('密码或用户名错误');
    }
  };

  onLoginFinishFailed = errorInfo => {
    console.log('Failed:', errorInfo);
  };  

  getPageHeaderTitle = (isLogin, isRegister, isUpdate) => {
    if (isLogin) {
      return '登陆';
    } else if (isRegister) {
      return '注册';
    } else if (isUpdate) {
      return '修改个人信息';
    } else {
      return '注册登陆页';
    }
  }

  render() {
    const { isLogin = false, isRegister = true, isUpdate = false } = this.props;
    const { onLoginFinish, onLoginFinishFailed } = this;

    let title = this.getPageHeaderTitle(isLogin, isRegister, isUpdate);

    return (
      <div className="login-page">
        <PageHeader
          className="login-page-header"
          onBack={() => null}
          title={title}
          subTitle="Flight Aware Monitoring Platform"
        />
        <Card
          hoverable
          style={{ width: '75%', marginTop: 20 }}
        >
          {
            isLogin && <Form
              {...layout}
              name="basic"
              initialValues={{ remember: true }}
              size="large"
              colon={false}
              style={{marginTop: 20}}
              onFinish={onLoginFinish}
              onFinishFailed={onLoginFinishFailed}
            >
              <Form.Item
                label="用户名"
                name="username"
                rules={[{ required: true, message: '请输入用户名' }]}
              >
                <Input />
              </Form.Item>

              <Form.Item
                label="密码"
                name="password"
                rules={[{ required: true, message: '请输入密码' }]}
              >
                <Input.Password />
              </Form.Item>

              <Form.Item {...tailLayout}>
                <Button type="primary" htmlType="submit">
                  登陆
                </Button>
              </Form.Item>
            </Form>
          }
          {
            isLogin && <Form
              {...layout}
              name="basic"
              initialValues={{ remember: true }}
              size="large"
              colon={false}
              style={{marginTop: 20}}
              onFinish={onLoginFinish}
              onFinishFailed={onLoginFinishFailed}
            >
              <Form.Item
                label="用户名"
                name="username"
                rules={[{ required: true, message: '请输入用户名' }]}
              >
                <Input />
              </Form.Item>

              <Form.Item
                label="密码"
                name="password"
                rules={[{ required: true, message: '请输入密码' }]}
              >
                <Input.Password />
              </Form.Item>

              <Form.Item
                label="再次确认密码"
                name="password"
                rules={[{ required: true, message: '请再次输入密码' }]}
              >
                <Input.Password />
              </Form.Item>

              <Form.Item {...tailLayout}>
                <Button type="primary" htmlType="submit">
                  登陆
                </Button>
              </Form.Item>
            </Form>
          }
        </Card>
      </div>
    );
  }
}

export default LoginPage;
